class Solution(object):    def addStrings(self, num1, num2):        """        :type num1: str        :type num2: str        :rtype: str        """        len1=len(num1)        len2=len(num2)        if len1<len2:            num1,num2=num2,num1            len1,len2=len2,len1        sum1=""        carry=0        for i in range(1,len2+1,1):            temp=int(num1[-i])+int(num2[-i])+carry            carry=int(temp/10)            temp-=int(carry*10)            sum1=str(temp)+sum1        for i in range(len2+1,len1+1,1):            temp = int(num1[-i])+ carry            carry = int(temp / 10)            temp -= int(carry * 10)            sum1 = str(temp)+sum1        if carry:            sum1=str(carry)+sum1        return sum1s=Solution()num1="987"num2="9876"print(s.addStrings(num1,num2))